import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './Home.css';

const Home = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const navigate = useNavigate();

  const categories = [
    { name: 'Property', icon: 'ðŸ ', slug: 'property', description: 'Houses, apartments, and commercial spaces', color: '#00bfff' },
    { name: 'Vehicles', icon: 'ðŸš—', slug: 'vehicles', description: 'Cars, bikes, and transportation', color: '#ff6b6b' },
    { name: 'Electronics', icon: 'ðŸ’»', slug: 'electronics', description: 'Gadgets, laptops, and tech devices', color: '#4ecdc4' },
    { name: 'Furniture', icon: 'ðŸª‘', slug: 'furniture', description: 'Home and office furniture', color: '#45b7d1' },
  ];

  const featuredListings = [
    { name: 'Clothing', icon: 'ðŸ‘•', description: 'Fashion and apparel rentals' },
    { name: 'Cameras', icon: 'ðŸ“¸', description: 'For shoots and events' },
    { name: 'Books', icon: 'ðŸ“š', description: 'Educational & hobby reads' },
  ];

  const handleSearch = (e) => {
    e.preventDefault();
    if (searchTerm.trim()) {
      navigate(`/listings?search=${encodeURIComponent(searchTerm.trim())}`);
    } else {
      navigate('/listings');
    }
  };

  return (
    <div className="home">
      {/* Hero Section */}
      <section className="hero-section">
        <div className="container">
          <div className="hero-content">
            <h1>Welcome to RentLONA.com</h1>
            <p>Find everything you need to rent - from properties to electronics and more!</p>
            <form className="search-bar" onSubmit={handleSearch}>
              <input
                type="text"
                placeholder="Search for rentals..."
                className="search-input"
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
              />
              <button type="submit" className="search-btn">Search</button>
            </form>
          </div>
        </div>
      </section>

      {/* Categories Section */}
      <section className="categories-section">
        <div className="container">
          <div className="section-header">
            <h2>Explore Categories</h2>
            <p>Find what you're looking for from our wide range of rental categories</p>
          </div>
          <div className="categories-grid">
            {categories.map((category) => (
              <Link
                key={category.slug}
                to={`/listings?category=${category.slug}`}
                className="category-card"
                style={{ '--category-color': category.color }}
              >
                <div className="category-icon">{category.icon}</div>
                <h3>{category.name}</h3>
                <p>{category.description}</p>
                <div className="category-stats">
                  <span className="stat-count">100+</span>
                  <span className="stat-text">Listings</span>
                </div>
              </Link>
            ))}
          </div>
        </div>
      </section>

      {/* Featured Listings Section */}
      <section className="featured-section">
        <div className="container">
          <div className="section-header">
            <h2>Featured Listings</h2>
            <p>Discover our most popular rental items</p>
          </div>
          <div className="featured-grid">
            {featuredListings.map((listing, index) => (
              <div key={index} className="featured-card">
                <div className="text-6xl mb-3">{listing.icon}</div>
                <h3 className="font-semibold text-lg mb-2">{listing.name}</h3>
                <p className="text-sm text-gray-500">{listing.description}</p>
                <p className="mt-4 text-blue-600 font-semibold">100+ Listings</p>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Stats Section */}
      <section className="stats-section">
        <div className="container">
          <div className="stats-header">
            <h2>Trusted by Thousands</h2>
            <p>Join our growing community of renters and lenders</p>
          </div>
          <div className="stats-grid">
            <div className="stat-card">
              <div className="stat-number">1000+</div>
              <div className="stat-label">Active Listings</div>
            </div>
            <div className="stat-card">
              <div className="stat-number">500+</div>
              <div className="stat-label">Happy Users</div>
            </div>
            <div className="stat-card">
              <div className="stat-number">50+</div>
              <div className="stat-label">Categories</div>
            </div>
            <div className="stat-card">
              <div className="stat-number">24/7</div>
              <div className="stat-label">Support</div>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
